import React from "react";
import { Box, Typography } from "@material-ui/core";

const Title = () => {
  return (
    <Box display="flex" justifyContent="center">
      <Typography component="h1" variant="h1">
        Sneaker Gallery
      </Typography>
    </Box>
  );
};

export default Title;
